// components/Dashboard.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css';

const tips = [
  "Stay hydrated by drinking at least 8 glasses of water daily",
  "Get 7-9 hours of quality sleep each night",
  "Include physical activity in your daily routine",
  "Eat a balanced diet with plenty of fruits and vegetables"
];

const Dashboard = ({ user, onLogout }) => {
  const navigate = useNavigate();

  const handleCardClick = (path) => {
    const container = document.querySelector('.dashboard-container');
    if (!container) return;

    container.classList.add('flip-out');

    // After animation ends, navigate to route
    container.addEventListener('animationend', () => {
      navigate(path);
    }, { once: true });
  };

  return (
    <div className="dashboard-container">
      <header className="dashboard-header glass-float">
        <div className="dashboard-header-gradient"></div>
        <h1>
          <span className="pulse-logo">üçÉ</span> Health Assistant
        </h1>
        <div className="user-menu float">
          <span className="user-welcome-text">Welcome, {user?.name}</span>
          <button onClick={onLogout} className="logout-btn jump-hover">Logout</button>
        </div>
      </header>
      
      <main className="dashboard-main">
        <div className="welcome-section fade-in">
          <h2>How can we help you today?</h2>
          <p>Get personalized health advice and information from our AI assistant.</p>
        </div>

        <div className="action-cards">
          <div
            role="button"
            tabIndex={0}
            onClick={() => handleCardClick('/chat')}
            onKeyPress={(e) => e.key === 'Enter' && handleCardClick('/chat')}
            className="action-card fade-up clickable-jump"
            style={{ animationDelay: '0.1s' }}
          >
            <div className="card-icon bounce">üí¨</div>
            <h3 className="emitting-text">Start Chat</h3>
            <p>Chat with our health assistant about your symptoms or concerns</p>
          </div>
          
          <div
            role="button"
            tabIndex={0}
            onClick={() => handleCardClick('/profile')}
            onKeyPress={(e) => e.key === 'Enter' && handleCardClick('/profile')}
            className="action-card fade-up clickable-jump"
            style={{ animationDelay: '0.25s' }}
          >
            <div className="card-icon bounce">üë§</div>
            <h3 className="emitting-text">My Profile</h3>
            <p>View and update your personal information and medical history</p>
          </div>
          
          <div
            role="button"
            tabIndex={0}
            onClick={() => handleCardClick('/history')}
            onKeyPress={(e) => e.key === 'Enter' && handleCardClick('/history')}
            className="action-card fade-up clickable-jump"
            style={{ animationDelay: '0.4s' }}
          >
            <div className="card-icon bounce">üìã</div>
            <h3 className="emitting-text">Chat History</h3>
            <p>Review your previous conversations with the health assistant</p>
          </div>
        </div>

        <div className="quick-tips glass-float fade-up" style={{ animationDelay: '0.6s' }}>
          <div className="tips-gradient"></div>
          <h3>Health Tips</h3>
          <ul>
            {tips.map((tip, idx) => (
              <li key={idx} className="fade-in" style={{ animationDelay: `${0.7 + idx * 0.09}s` }}>
                {tip}
              </li>
            ))}
          </ul>
        </div>
      </main>
    </div>
  );
};

export default Dashboard;
